import Card from "./Card";
import data from "./Sdata";
function App() {
  return (
    <>
      <h1 className="heading_style"> Top 5 series of Netflex</h1>
      <Card
        imagsrc={data[0].imagsrc}
        title={data[0].title}
        sname={data[0].sname}
        link={data[0].link}
      />
      <Card
        imagsrc={data[1].imagsrc}
        title={data[1].title}
        sname={data[1].sname}
        link={data[1].link}
      />
      <Card
        imagsrc={data[2].imagsrc}
        title={data[2].title}
        sname={data[2].sname}
        link={data[2].link}
      />
      <Card
        imagsrc={data[3].imagsrc}
        title={data[3].title}
        sname={data[3].sname}
        link={data[3].link}
      />
      <Card
        imagsrc={data[4].imagsrc}
        title={data[4].title}
        sname={data[4].sname}
        link={data[2].link}
      />
    </>
  );
}
export default App;
